import React from "react";

function Stats({ ipAddress, location, timeZone, isp, coordinates }) {
  return (
    <div className="stats-details">
      <div>
        <p>IP Address</p>
        {ipAddress}
      </div>
      <div>
        <p>Location</p>
        {location}
      </div>
      <div>
        <p>TimeZone</p>
        {timeZone}
      </div>
      <div>
        <p>ISP</p>
        {isp}
      </div>
    </div>
  );
}

export default Stats;
